export const sx = {
   wrapper: {
      height: '80vh',
      width: '100%',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
   },

   content: {
      fontSize: '18px',
      color: '#828FA3',
      fontWeight: 700,
      mb: 4,
      textAlign: 'center',
   },

   button: { width: 'fit-content', px: 2 },
};
